import React from "react";
import "./Contact.css"; // Подключаем CSS стили для контактов

const Contact = () => {
    return (
        <div className="contact-section section">
            <div className="contact-text">
                <h2>Контакты</h2>
                <p>Мы всегда рады помочь вам! Свяжитесь с нами любым удобным способом:</p>
                <ul>
                    <li>Телефон: +7 (000) 000-00-00</li>
                    <li>Электронная почта: info@example.com</li>
                    <li>Адрес: г. Москва, ул. Примерная, д. 10</li>
                </ul>
            </div>
            <div className="contact-map">
                <iframe
                    src="https://maps.google.com/maps?q=Москва,+ул.+Примерная,+д.+10&output=embed"
                    allowFullScreen=""
                    loading="lazy"
                    title="Google Map"
                ></iframe>
            </div>
        </div>
    );
};





const styles = {
    container: {
        padding: '40px 20px',
        backgroundColor: '#f4f4f4',
        textAlign: 'center',
    },
    title: {
        fontSize: '32px',
        fontWeight: 'bold',
        marginBottom: '20px',
    },
    text: {
        fontSize: '18px',
        color: '#333',
        marginBottom: '10px',
    },
    contactInfo: {
        display: 'flex',
        justifyContent: 'center',
        gap: '30px',
        flexWrap: 'wrap',
    },
    contactItem: {
        flex: '1 1 200px',
    },
    label: {
        fontWeight: 'bold',
        fontSize: '16px',
    },
};

export default Contact;
